import {INCREASE_TOTAL_SCORE, SUBMITTED} from './actionTypes'

export function increaseTotalScore(score) {
  return {
    type: INCREASE_TOTAL_SCORE,
    score
    
  }
}

export function submitted() {
  return {
    type: SUBMITTED,
    
  }
}
